  \"graphic-preview-description\",\n\t\t\"value\": \"The May 18 eruption, viewed from
  the east in late morning. The eruptive cloud rose to an altitude of more than 12
  miles in ten minutes. The swirling ash particles in the eruptive cloud generated
  lightning which in turn started forest fires. Other fires were ignited by the initial
  blasts and later pyroclastic flows. Ash can be seen falling out of the cloud. Nearly
  550 million tons of ash fell over a 22,000 square mile area on May 18.\"\n\t},\n\t{\n\t\t\"key\":
